import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { useAuth } from '../auth/AuthContext';
import DocumentUploader from './DocumentUploader';
import DocumentViewer from './DocumentViewer';

interface Document {
  id: number;
  title: string;
  description: string;
  category: string;
  fileUrl: string;
  createdAt: Date;
  updatedAt: Date;
}

const Vault: React.FC = () => {
  const auth = useAuth();
  const [documents, setDocuments] = useState<Document[]>([]);
  const [categories, setCategories] = useState<string[]>([]);
  const [years, setYears] = useState<number[]>([]);
  const [selectedCategory, setSelectedCategory] = useState<string>('');
  const [selectedYear, setSelectedYear] = useState<number | ''>('');
  const [showUploader, setShowUploader] = useState(false);

  const fetchCategories = async () => {
    try {
      const response = await axios.get('http://localhost:3000/documents/categories');
      setCategories(response.data);
    } catch (error) {
      alert('Error fetching categories');
    }
  };

  const fetchYears = async (category: string) => {
    try {
      const response = await axios.get(`http://localhost:3000/documents/years?category=${category}`);
      setYears(response.data);
    } catch (error) {
      alert('Error fetching years');
    }
  };

  const fetchDocuments = async (category: string, year: number) => {
    try {
      const response = await axios.get(`http://localhost:3000/documents?category=${category}&year=${year}`);
      setDocuments(response.data.documents);
    } catch (error) {
      alert('Error fetching documents');
    }
  };

  useEffect(() => {
    fetchCategories();
  }, []);

  const handleCategoryChange = (event: React.ChangeEvent<HTMLSelectElement>) => {
    const category = event.target.value;
    setSelectedCategory(category);
    setSelectedYear(''); // Reset year when category changes
    if (category) {
      fetchYears(category);
    } else {
      setYears([]);
      setDocuments([]);
    }
  };

  const handleYearChange = (event: React.ChangeEvent<HTMLSelectElement>) => {
    const year = parseInt(event.target.value, 10);
    setSelectedYear(year);
    if (year) {
      fetchDocuments(selectedCategory, year);
    } else {
      setDocuments([]);
    }
  };

  const handleToggleUploader = () => {
    setShowUploader(!showUploader);
  };

  return (
    <div>
      <h2>Coffre-fort numérique</h2>
      {auth.user?.role === 'admin' && (
        <div>
          <p>Accès complet pour l'Admin.</p>
          <button onClick={handleToggleUploader}>
            {showUploader ? 'Masquer' : 'Ajouter un fichier'}
          </button>
          {showUploader && <DocumentUploader onUploadSuccess={() => fetchDocuments(selectedCategory, selectedYear as number)} />}
        </div>
      )}

      <div>
        <h3>Filtrer les documents</h3>
        <div>
          <label>
            Catégorie:
            <select value={selectedCategory} onChange={handleCategoryChange}>
              <option value="">-</option>
              {categories.map((category, index) => (
                <option key={index} value={category}>{category}</option>
              ))}
            </select>
          </label>
        </div>
        {selectedCategory && (
          <div>
            <label>
              Année:
              <select value={selectedYear} onChange={handleYearChange}>
                <option value="">-</option>
                {years.map((year, index) => (
                  <option key={index} value={year}>{year}</option>
                ))}
              </select>
            </label>
          </div>
        )}
      </div>

      <div>
        <h3>Documents</h3>
        {documents.length > 0 ? (
          <ul>
            {documents.map((doc) => (
              <li key={doc.id}>
                <DocumentViewer document={doc} />
              </li>
            ))}
          </ul>
        ) : (
          <p>Aucun document disponible.</p>
        )}
      </div>
    </div>
  );
};

export default Vault;
